import React from 'react';

const BlueprintTable = ({ blueprints, onOpen }) => {
  return (
    <table id="blueprintsTable">
      <thead>
        <tr>
          <th>Nombre del plano</th>
          <th>Número de puntos</th>
          <th>Acciones</th>  {/* Nueva columna para el botón */}
        </tr>
      </thead>
      <tbody>
        {blueprints.map((blueprint, index) => (
          <tr key={index}>
            <td>{blueprint.name}</td>
            <td>{blueprint.points}</td>
            <td>
              <button onClick={() => onOpen(blueprint)}>Abrir</button>  {/* Botón Abrir */}
            </td>
          </tr>
        ))}
      </tbody>
    </table>
  );
};

export default BlueprintTable;
